import logo from "./logo.svg";
import "./App.css";

import { useEffect } from "react";

function App() {
  useEffect;

  fetch("http://localhost:5000/api/videoslist")
    .then(function (response) {
      if (response.ok) {
        alert(response.body);
      }
    })
    .catch(function (error) {});

  return (
    <div className="App">
      <div className="video-playlist"></div>
    </div>
  );
}

export default App;
